import React from 'react';
import { Link } from 'react-router-dom';

const Regestration: React.FC = () => {
    contentForm()
    return(
        <div className="containerRegestration">
            <div className="conteiner-form">
            </div>
            <div>
                <Link to="/">На главную</Link>
            </div>
        </div>
    )
}
export default Regestration;
